import React from "react";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li>
          <Link>
            <img alt="Carved Rock Fitness" src="/images/logo.png" />
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}
